function LocItem(obj,cont,pop){
obj.dot.style.display='block';
obj.dot.addEventListener('mouseover',mo);
obj.dot.addEventListener('mouseout',mout);
colors.forEach(c=>{
if(obj.Tipo==c.Tipo){
obj.path.classList.add(c.class);
}

});

function mo(e){
if(e)e.preventDefault();
let cx=this.getAttribute('cx');
let cy=this.getAttribute('cy');

let pos=getPosition(cont);
let x=e.clientX-pos.x;
let y=e.clientY-pos.y;

pop.style.display='block';
if(cx<520){
    pop.style.left=`${x+12}px`;
} else {
    pop.style.left=`${x-280}px`;
}
if(cy>600){
pop.style.top=`${y-160}px`;
}else 
{
    pop.style.top=`${y-40}px`;
    }
pop.innerHTML=`<h3 style='display:inline-block;margin:0;'>${obj.Jurisdiccion}</h3>
<!--${obj.Tipo?`<br><i>${obj.Tipo}</i>`:''} -->
${obj.year?`<br><b>Año</b>: ${obj.year}`:''}

${obj.Nombre?`<br><i>"${obj.Nombre}"</i>`:''}
${obj.Sector_de_gestion?`<br><br><b>Sector de gestión:</b><br>${obj.Sector_de_gestion.split('\n\n').join(' / ')}.`:``}
${obj.Unidades_de_registro?`<br><br><b>Unidades de registro:</b><br>${obj.Unidades_de_registro.split('\n\n').join(' - ')}.`:``}
${obj.Nivel_ensenanza?`<br><br><b>Nivel de enseñanza:</b><br>${obj.Nivel_ensenanza.split('\n\n').join(' - ')}.`:``}
${obj.Indicadores?`<br><br><b>Indicadores únicos para:</b><br>${obj.Indicadores.split('\n\n').join(' - ')}.`:``}
${obj.Variables?`<br><br><b>Variables:</b><br>${obj.Variables.split('\n\n').join(' - ')}.`:``}


`;
obj.path.classList.add('over');


}

function mout(e){
if(e)e.preventDefault();
pop.style.display='none';
obj.path.classList.remove('over');


}




}

function getPosition(element) {
const rect = element.getBoundingClientRect();
const x = rect.left;// + window.scrollX;
const y = rect.top;// + window.scrollY;

return {x,y};
}


